import React from "react";
import { useState } from "react";
import style from "./addtask.module.css";
import axios from "axios";
import { useEffect } from "react";
const AddTask = () => {
  const [click, setClick] = useState(false);
  const [data, setData] = useState();
  const [UName, setUName] = useState();
  const [UEmail, setUEmail] = useState();
  const [UTask, setUTask] = useState();
  const [UPass, setUPass] = useState();
  const [TLevel, setTLevel] = useState();

  useEffect(() => {}, []);
  console.log(data);
  return (
    <div
      className={
        (click ? style.click : style.addTask) + " position-absolute center"
      }
    >
      <div
        className={
          (click ? style.btnclick : " ") + " global position-absolute center"
        }
        onClick={() => {
          click ? setClick(false) : setClick(true);
        }}
      >
        +
      </div>
      <div>
        <input
          onChange={(e) => {
            setUName(e.target.value);
          }}
          type="text"
          placeholder="Add task"
        />
        <input
          onChange={(e) => {
            setUEmail(e.target.value);
          }}
          type="text"
          placeholder="Add task"
        />
        <input
          onChange={(e) => {
            setUPass(e.target.value);
          }}
          type="text"
          placeholder="Add task"
        />
        <select
          onChange={(e) => {
            setTLevel(e.target.value);
          }}
        >
          <option value="1">very important</option>
          <option value="0">important</option>
          <option value="-1">not important</option>
        </select>
        <input
          onChange={(e) => {
            setUTask(e.target.value);
          }}
          type="text"
          placeholder="Add task"
        />
        <button
          onClick={() => {
            SingUp();
          }}
        ></button>
      </div>
    </div>
  );
};

export default AddTask;

